import React from 'react'
import './Scalp.css';
import TradingViewWidget from 'react-tradingview-widget';

export default function Scalp() {

let width = TradingViewWidget.width = '980px'
let heighty = TradingViewWidget.height = '610px'
let themey = TradingViewWidget.theme = 'Dark' ;
let indicators =  TradingViewWidget.studies = [ "TripleEMA@tv-basicstudies",  "RSI@tv-basicstudies"]

return (

<div className="ScalpChart">

<i class="arrow">NEXT</i>

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='1'
    studies={indicators}  
    hide_side_toolbar={false}
    width={1000}
    height={1000}        
  />

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='3'
    studies={indicators}  
    hide_side_toolbar={false}
    width={1000}
    height={1000} 

  />

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='15'
    studies={indicators}  
    hide_side_toolbar={false}
    width={1000}
    height={1000}       
  />

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='45'
    studies={indicators}  
    hide_side_toolbar={false}
    width={1000}
    height={1000} 
  />

</div>
)
}
